import React from 'react';
import todoListContainer from '../containers/todosList.container';
import { connect } from 'react-redux';

const TodoList = ({todoList}) => {

    if (!todoList.length) {
        todoList = [];
        console.log(todoList);
    }

    return (
        <div className='container'>
            <h3 style={{marginBottom: 20}}>Todos list</h3>
            <table className='table table-hover'>
                <thead>
                    <tr>
                        <th>Description</th>
                        <th>Responsible</th>
                        <th>Priority</th>
                        <th>Completed</th>
                        <th>Actions</th>
                    </tr>
                </thead>
                <tbody>
                    {todoList.map(todo => {
                        return (
                            <tr key={todo._id}>
                                <td>{todo.todoDescription}</td>
                                <td>{todo.todoResponsible}</td>
                                <td>{todo.todoPriority}</td>
                            </tr>
                        )
                        })
                    }
                    {console.log(todoList)}
                </tbody>
            </table>
        </div>
    )
}
export default connect(todoListContainer.mapStateToProps)(TodoList);
